import React, { useState, useEffect, useRef } from "react";
import Web3 from "web3";
import detectEthereumProvider from "@metamask/detect-provider";

const CONTRACT_ABI = [
  {
    "anonymous": false,
    "inputs": [
      {
        "indexed": false,
        "internalType": "uint256",
        "name": "id",
        "type": "uint256"
      },
      {
        "indexed": false,
        "internalType": "string",
        "name": "name",
        "type": "string"
      },
      {
        "indexed": false,
        "internalType": "uint256",
        "name": "social",
        "type": "uint256"
      },
      {
        "indexed": false,
        "internalType": "uint256",
        "name": "math",
        "type": "uint256"
      },
      {
        "indexed": false,
        "internalType": "uint256",
        "name": "naturalScience",
        "type": "uint256"
      }
    ],
    "name": "ReportCreated",
    "type": "event"
  },
  {
    "inputs": [
      {
        "internalType": "uint256",
        "name": "_id",
        "type": "uint256"
      },
      {
        "internalType": "string",
        "name": "_name",
        "type": "string"
      },
      {
        "internalType": "uint256",
        "name": "_social",
        "type": "uint256"
      },
      {
        "internalType": "uint256",
        "name": "_math",
        "type": "uint256"
      },
      {
        "internalType": "uint256",
        "name": "_naturalScience",
        "type": "uint256"
      }
    ],
    "name": "createReport",
    "outputs": [],
    "stateMutability": "nonpayable",
    "type": "function"
  },
  {
    "inputs": [
      {
        "internalType": "uint256",
        "name": "_id",
        "type": "uint256"
      }
    ],
    "name": "getReport",
    "outputs": [
      {
        "internalType": "uint256",
        "name": "",
        "type": "uint256"
      },
      {
        "internalType": "string",
        "name": "",
        "type": "string"
      },
      {
        "internalType": "uint256",
        "name": "",
        "type": "uint256"
      },
      {
        "internalType": "uint256",
        "name": "",
        "type": "uint256"
      },
      {
        "internalType": "uint256",
        "name": "",
        "type": "uint256"
      }
    ],
    "stateMutability": "view",
    "type": "function"
  }
];
const CONTRACT_ADDRESS = "0xC5d4E9cb0ad002ee215f22b61e72167f10D138D8";

function App() {
  const [web3, setWeb3] = useState(null);
  const [contract, setContract] = useState(null);
  const [accounts, setAccounts] = useState([]);

  const reportIdInput = useRef();
  const nameInput = useRef();
  const socialInput = useRef();
  const mathInput = useRef();
  const naturalScienceInput = useRef();
  const getReportIdInput = useRef();

  useEffect(() => {
    const init = async () => {
      const provider = await detectEthereumProvider();

      if (provider) {
        const web3Instance = new Web3(provider);
        setWeb3(web3Instance);

        const contractInstance = new web3Instance.eth.Contract(
          CONTRACT_ABI,
          CONTRACT_ADDRESS
        );
        setContract(contractInstance);

        const accounts = await web3Instance.eth.getAccounts();
        setAccounts(accounts);
      } else {
        alert("Metamask belum terpasang atau belum diaktifkan!");
      }
    };

    init();
  }, []);

  const createReport = async (id, name, social, math, naturalScience) => {
    if (contract && accounts.length > 0) {
      await contract.methods
        .createReport(id, name, social, math, naturalScience)
        .send({ from: accounts[0] });
      alert("Laporan berhasil dibuat!");
    }
  };

  const getReport = async (id) => {
    if (contract) {
      const report = await contract.methods.getReport(id).call();
      console.log(report);
      alert(`Nama: ${report[1]}, Sosial: ${report[2]}, Matematika: ${report[3]}, IPA: ${report[4]}`);
    }
  };

  return (
    <div className="App">
      <div>
        <h2>Buat Laporan</h2>
        <input type="number" placeholder="ID" ref={reportIdInput} />
        <input type="text" placeholder="Nama" ref={nameInput} />
        <input type="number" placeholder="Sosial" ref={socialInput} />
        <input type="number" placeholder="Matematika" ref={mathInput} />
        <input
          type="number"
          placeholder="IPA"
          ref={naturalScienceInput}
        />
        <button
          onClick={() =>
            createReport(
              reportIdInput.current.value,
              nameInput.current.value,
              socialInput.current.value,
              mathInput.current.value,
              naturalScienceInput.current.value
            )
          }
        >
          Buat Laporan
        </button>
      </div>
      <div>
        <h2>Ambil Laporan</h2>
        <input
          type="number"
          placeholder="ID"
          ref={getReportIdInput}
        />
        <button onClick={() => getReport(getReportIdInput.current.value)}>
          Ambil Laporan
        </button>
      </div>
    </div>
  );
}

export default App;
